app.directive('listEventPlayer', function($http, $rootScope) {
  return {
    restrict: 'A',
    link: function(scope, element, attrs) {
      $http({
        method: 'GET',
        data: {
          eid: scope.ev.eid
        },
        url: '/api/list_player/' + scope.ev.eid
      }).success(function(data) {
              scope.ev.list_event_players = data;
        });
    }
  };
});

